;b&gt;左转&lt;/b&gt;进入&lt;b&gt;蔡伦路&lt;/b&gt;&lt;br/&gt;17. 沿&lt;b&gt;蔡伦路&lt;/b&gt;行驶380米，在&lt;b&gt;蔡伦路三星河桥&lt;/b&gt;&lt;b&gt;右转&lt;/b&gt;&lt;b&gt;&lt;/b&gt;&lt;br/&gt;18. &lt;b&gt;&lt;/b&gt;行驶10米，过&lt;b&gt;复旦大学张江校区北门&lt;/b&gt;&lt;b&gt;右转&lt;/b&gt;进入&lt;b&gt;日月环路&lt;/b&gt;&lt;br/&gt;19. 沿&lt;b&gt;日月环路&lt;/b&gt;行驶190米，&lt;b&gt;左转&lt;/b&gt;&lt;b&gt;&lt;/b&gt;&lt;br/&gt;20. &lt;b&gt;&lt;/b&gt;行驶80米，&lt;b&gt;左转&lt;/b&gt;&lt;br/&gt;21. &lt;b&gt;&lt;/b&gt;行驶50米，到达&lt;b&gt;终点&lt;/b&gt;', '2014-02-17 23:04:10', '2014-02-17 23:04:10', null, '0');
